import React from "react";
import { Link } from "react-router-dom";
import { Package, Plus } from "lucide-react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-modern">
      <div className="container">
        <Link className="brand-container" to="/">
          <div className="brand-icon">
            <Package size={24} color="white" />
          </div>
          <div className="brand-text">
            <div className="brand-name">CargoTrack</div>
            <div className="brand-tagline">Shipment Management</div>
          </div>
        </Link>

        <div className="d-flex align-items-center">
          <Link className="nav-link-modern" to="/">
            Dashboard
          </Link>

          <Link className="btn-primary-modern" to="/new-shipment">
            <Plus size={16} style={{ marginRight: '8px' }} />
            New Shipment
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
